import React, { useState, useEffect } from "react";
import { FetchAllPlayers } from "./Create.js";
import AllPuppies from "./Cards"

const dummypuppies = [{ id: 9989, name: 'Rex', breed: 'Shiba Inu', status: 'bench', imageUrl: 'https://images.pexels.com/photos/1805164/pexels-photo-1805164.jpeg?auto=compress&cs=tinysrgb&w=400' },
{ id: 9989, name: 'some', breed: 'Shiba Inu', status: 'bench', imageUrl: 'https://images.pexels.com/photos/1805164/pexels-photo-1805164.jpeg?auto=compress&cs=tinysrgb&w=400' }
]


export const Main = () => {
    const [puppies, setPuppies] = useState([]);

    useEffect(() => {
        const players = FetchAllPlayers();
        console.log
        setPuppies(players)
    }, []);
return (
    <div>
        <h1>Welcome to Puppy Bowl</h1>
        <div id="navbar"></div>
        <div>
            <AllPuppies puppies = {puppies}/>
        </div>
    </div>
);
}
